//    private final String ask_current_media_modify = "{\"asrRewrite\":\"\",\"asrSn\":\"fake-ask-current-media-modify\",\"audioZoneIndex\":2,\"botSessionList\":[{\"audioZoneIndex\":0,\"sessionList\":[{\"asr\":\"帮我激活Asd\",\"dstData\":[{\"customContext\":{\"isInside\":true},\"dmStatus\":{\"entitySlots\":[],\"isMultiForce\":false,\"skill\":\"autoPilot\",\"type\":\"FINISH_DIALOGUE\"},\"nlu\":{\"confidence\":0.95,\"domain\":\"autoPilot\",\"intent\":\"CONTROL_AUTO_PILOT\",\"slots\":[{\"name\":\"action\",\"normalizedValue\":\"OPEN\",\"value\":\"激活\"}]}}],\"isHitVts\":false,\"sn\":\"4b988e67-8a62-466b-886b-427e2b10585e-0\",\"source\":\"JIDU_ONLINE\",\"speechMode\":\"inside\",\"timestamp\":1721789305460},{\"asr\":\"百城都可用Asd是什么时候\",\"asrOutputRewrite\":\"\",\"dstData\":[{\"customContext\":{\"isInside\":true,\"tts\":\"我们将在6-7月把ASD点到点领航辅助开通城市增加到300+城，并在今年实现全国都能开！\"},\"dmStatus\":{\"entitySlots\":[],\"isMultiForce\":false,\"skill\":\"knowledge\",\"type\":\"FINISH_DIALOGUE\"},\"nlu\":{\"confidence\":0.95,\"domain\":\"knowledge\",\"intent\":\"JIYUE_KNOWLEDGE\"}}],\"isHitVts\":false,\"sn\":\"d81494ca-5988-416a-8db1-556f8eb9ddfc-0\",\"source\":\"JIDU_ONLINE\",\"speechMode\":\"inside\",\"timestamp\":1721789307956}]},{\"audioZoneIndex\":1,\"sessionList\":[{\"asr\":\"三伏天怎么养生\",\"asrOutputRewrite\":\"\",\"dstData\":[{\"customContext\":{\"isInside\":true,\"tts\":\"三伏天是一年中温度最高、既潮湿又闷热的时间段，养生方法主要包括以下几个方面：\\n一、饮食调节\\n1. 适当补水：三伏天温度过高，机体失水多，要及时补水以满足身体代谢的需要，但要避免一次性大量饮水，应分少量多次补水，必要时还可以适当饮用淡盐水。\\n2. 丰富饮食：饮食应清淡、好消化，避免进食辛辣、油腻的食物，可适当多吃爽口开胃的蔬果，如黄瓜、苦瓜、西瓜、西红柿、杨梅等，其味道清爽还可起到补水的功效。中医认为，还可适当进食绿豆、冬瓜等清热解暑的食物，有助于养生。\\n3. 避免贪食冷饮：少吃冷饮，尤其小孩子阳气正在成长中，过食冷饮，易出现鼻炎、咽炎等呼吸疾病以及反复的扁桃体发炎、发烧、脾胃不和等问题。\\n二、生活作息\\n1. 固护阳气：避免熬夜，早睡早起，适当休息，避免劳累过度，养成规律作息。\\n2. 避免长时间空调直吹：夜晚睡觉时，门窗别开小缝，以防虚邪贼风。建议空调温度调至26℃左右为宜。\\n3. 睡午觉：三伏时节因天气炎热，晚上睡眠会受到一定影响，建议尽量午睡，午睡后可以轻微活动，喝一杯水，以稀释血液黏稠度，能有效预防冠心病、心梗等心脏疾病的发生。\\n三、运动锻炼\\n1. 选择适宜的运动：不适宜选择剧烈的运动，更适合选择活动量较小的活动，如游泳、瑜伽、太极拳、八段锦、散步等，尽量避免在户外高温下活动。\\n2. 控制运动时间：避免高温的时间段，尽量选择凉爽、阴凉的环境进行活动，且要控制运动时间，避免高强度运动引起中暑症状。\\n四、物理预防\\n1. 三伏贴：在夏季三伏天通过将药物敷贴到人体一定穴位，通过皮肤吸收渗透、经脉气血运行传输直达病所，以达祛病强身，病祛体安之功效，是治疗和预防疾病的一种外治方法。\\n2. 热水泡脚：三伏天阳气最盛，热水泡脚可以通过刺激足阳明胃经、足太阳膀胱经等足部的六条经络，从而起到健脾、除湿、通经、利水的作用。\\n3. 艾灸：由于三伏天气温高，人体内阳气上升，经络通达、气血充沛、精力旺盛，此时通过借助药物对穴位的刺激进行艾灸，容易引导药物由皮肤渗入穴位经络，以达到温经散寒、疏通经络、活血通脉的效果，但应在专业医生操作下进行，避免私自操作。\\n五、其他注意事项\\n1. 避免太阳直晒：下午1-3点尽量减少外出，以防出现中暑现象。\\n2. 调节情绪：保持良好的心情和心态，避免不良情绪对身体的影响。\\n综上所述，三伏天的养生方法主要包括饮食调节、生活作息调整、适当运动、物理预防以及其他注意事项等方面。通过科学合理的养生方法，可以帮助我们更好地适应三伏天的气候特点，保持身体健康。\"},\"dmStatus\":{\"entitySlots\":[],\"isMultiForce\":false,\"skill\":\"lifeService\",\"type\":\"FINISH_DIALOGUE\"},\"nlu\":{\"confidence\":0.95,\"domain\":\"lifeService\",\"intent\":\"WIKI_QA\"}}],\"isHitVts\":false,\"sn\":\"d2d96248-88c7-427d-956a-0129bda30254-1\",\"source\":\"JIDU_ONLINE\",\"speechMode\":\"inside\",\"timestamp\":1721789273817},{\"asr\":\"上海有单价1万多的房子吗\",\"asrOutputRewrite\":\"\",\"dstData\":[{\"customContext\":{\"isInside\":true,\"tts\":\"上海有单价1万多的房子，但这类房子主要集中在郊区或者偏远地段。例如，崇明、金山、奉贤和临港附近的一些地方，可能可以找到单价1万多一平的二手房，甚至一些小户型四五十万一套的房源。\\n然而，需要注意的是，这类房源的地段相对偏远，交通和生活配套可能不如市中心完善。同时，随着上海房地产市场的变化，这类低价房源的数量和价格也可能会有所波动。\\n因此，如果考虑购买单价1万多的房子，建议仔细考察房源的地段、交通、生活配套等因素，并咨询专业的房地产机构或经纪人，以获取更准确的市场信息和购房建议。\"},\"dmStatus\":{\"entitySlots\":[],\"isMultiForce\":false,\"skill\":\"lifeService\",\"type\":\"FINISH_DIALOGUE\"},\"nlu\":{\"confidence\":0.95,\"domain\":\"lifeService\",\"intent\":\"WIKI_QA\"}}],\"isHitVts\":false,\"sn\":\"9aff04a1-6901-48a4-914d-3d6912988693-1\",\"source\":\"JIDU_ONLINE\",\"speechMode\":\"inside\",\"timestamp\":1721789319004},{\"asr\":\"新能源智驾功能可靠吗\",\"asrOutputRewrite\":\"新能源智驾功能可靠吗\",\"dstData\":[{\"customContext\":{\"isInside\":true,\"tts\":\"新能源智驾功能是否可靠，主要取决于其感知、算力和算法等多个方面。极越07配备了丰富的智能驾驶硬件，包括32个左右的传感器，共有11颗智能驾驶摄像头等，这些硬件为智驾功能提供了全面的路况信息获取能力。同时，极越07还拥有强大的算力和先进的算法，能够实现高精度的环境感知和障碍物检测，以及快速的数据迭代和AI能力提升。因此，从硬件配置和技术实力来看，极越07的新能源智驾功能是可靠的。\"},\"dmStatus\":{\"entitySlots\":[],\"isMultiForce\":false,\"skill\":\"knowledge\",\"type\":\"FINISH_DIALOGUE\"},\"nlu\":{\"confidence\":100.0,\"domain\":\"knowledge\",\"intent\":\"JIYU