//    private final String python_code = "{\"asrRewrite\":\"写一个计算加减乘除的Python函数\",\"asrSn\":\"fake-python-code\",\"audioZoneIndex\":0,\"botSessionList\":[{\"audioZoneIndex\":0,\"sessionList\":[{\"asr\":\"介绍一下弗洛伊德\",\"asrOutputRewrite\":\"\",\"dstData\":[{\"customContext\":{\"isInside\":true,\"tts\":\"弗洛伊德（Sigmund Freud）是心理学史上的一位重要人物，被誉为“精神分析之父”。以下是对他的详细介绍\\n\\n一、生平与背景\\n\\n* 弗洛伊德于1856年5月6日出生于摩拉维亚，4岁时举家迁居维也纳。\\n* 他在17岁时考入维也纳大学医学院，并在1881年开始私人开业。\\n* 弗洛伊德在职业生涯中发表了多部重要著作，包括《梦的解析》和《精神分析引论》等。\\n* 他于1938年遭纳粹迫害迁居伦敦，最终在1939年12月23日因口腔癌在伦敦逝世。\\n\\n二、理论与贡献\\n\\n1. 潜意识与人格理论：弗洛伊德提出了潜意识的概念，并认为人的心理分为意识和潜意识两个部分。他创建了以无意识为中心的理论体系，将人格结构划分为本我、自我和超我。\\n\\n\\t* 本我代表原始冲动和欲望，遵循“快乐原则”\\n\\t* 自我则起着平衡协调的作用，处理现实与本我、超我之间的冲突。\\n\\t* 超我则代表道德和社会规范，对个体行为进行监督和约束。\\n2. 梦论：弗洛伊德认为梦是潜意识中欲望的满足，梦的内容经过改装以逃避检查。他通过分析梦境来探索个体的潜意识动机和冲突。\\n3. 焦虑与心理防御机制弗洛伊德认为焦虑是潜意识中冲突的表现，而个体为了缓解焦虑会采用各种心理防御机制，如压抑、投射、否认等。\\n4. 社会文化理论：尽管弗洛伊德的理论主要关注个体内部的心理过程，但他也探讨了社会文化因素对个体心理发展的影响。他认为文明的发展源自“性”与“欲”这种动力，但同时也对个体产生了限制和压抑。\\n\\n三、影响与争议\\n\\n* 弗洛伊德的理论自诞生之日起就饱受争议，但他的影响力却持久不衰。他的理论为现代医学模式奠定了新基础，促进了动力心理学、人格心理学和变态心理学的发展。\\n* 他创立的精神分析学派在心理学史上具有重要地位，其追随者进一步发展了他的理论，形成了新的精神分析学派。\\n\\n总的来说，弗洛伊德是一位具有深远影响的心理学家，他的理论为我们理解人类心理和行为提供了新的视角和方法。\"},\"dmStatus\":{\"entitySlots\":[],\"isMultiForce\":false,\"skill\":\"lifeService\",\"type\":\"FINISH_DIALOGUE\"},\"nlu\":{\"confidence\":0.95,\"domain\":\"lifeService\",\"intent\":\"REAL_TIME_INQUIRY\"}}],\"isHitVts\":false,\"sn\":\"588f2b28-7138-4af8-bee2-b47c2784e13f-0_2\",\"source\":\"JIDU_ONLINE\",\"speechMode\":\"inside\",\"timestamp\":1721375849256},{\"asr\":\"画一张梦境中的图片\",\"dstData\":[{\"customContext\":{\"isInside\":true},\"dmStatus\":{\"entitySlots\":[],\"isMultiForce\":false,\"skill\":\"lifeService\",\"type\":\"FINISH_DIALOGUE\"},\"nlu\":{\"confidence\":0.95,\"domain\":\"lifeService\",\"intent\":\"DRAW\"}}],\"isHitVts\":false,\"sn\":\"21bbfdd0-22f8-46bc-9cbc-d975ed1a77cc-0\",\"source\":\"JIDU_ONLINE\",\"speechMode\":\"inside\",\"timestamp\":1721375858967},{\"asr\":\"画一张梦境中的图片\",\"asrOutputRewrite\":\"\",\"ds